const TabSelector = ({
  tab,
  activeTab,
  setActiveTab,
  topZIndex,
  setTopZIndex,
  i,
}: {
  tab: Tab;
  activeTab: number;
  setActiveTab: any;
  topZIndex: number;
  setTopZIndex: any;
  i: number;
}) => {
  const Icon = Icons[tab.icon];

  const [isHovered, setIsHovered] = React.useState(false);
  const themeColors = ["#4DA6E0", "#EF1F80", "#8F6CB6", "#FFBB57"];

  const themeColor = themeColors[i % themeColors.length];

  const containerStyle = {
    backgroundColor: isHovered
      ? themeColor
      : activeTab === tab.id
      ? themeColor
      : "#EEF5FB",
  };

  const iconStyle = {
    color: isHovered ? "white" : activeTab === tab.id ? "white" : themeColor,
  };

  return (
    <div
      onClick={() => {
        setActiveTab(tab.id);
        setTopZIndex(topZIndex + 1);
      }}
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
      style={containerStyle}
      className={`w-full rounded-md tran-300 ease-in-out transition-[2s]  lg:aspect-[1/1.2] cursor-pointer justify-center p-6 shadow-clg flex flex-col gap-2 items-center group text-center`}
    >
      <Icon style={iconStyle} className={`w-12 h-12 group-hover:text-white `} />
      <p
        style={iconStyle}
        className={`text-xl font-bold group-hover:text-white
`}
      >
        {tab.label}
      </p>
    </div>
  );
};

const DetailSection = ({
  children,
  activeTab,
  index,
  topZIndex,
}: {
  children: React.ReactNode;
  activeTab: number;
  index: number;
  topZIndex: number;
}) => {
  const [zIndex, setZIndex] = React.useState(1);

  useEffect(() => {
    if (activeTab === index) {
      setZIndex(topZIndex);
    }
  }, [activeTab, topZIndex, index]);

  return (
    <div
      className={` flex flex-col lg:grid  lg:grid-rows-1   h-[1150px] xsm:h-[1200px] sm:h-[1250px]  md:h-[1050px] lg:h-[600px]  lg:grid-cols-2 gap-10 lg:gap-20 items-center w-full justify-start lg:justify-between absolute  bg-[#EEF5FB] 
  ${activeTab === index ? `top-0 slide-up` : "-bottom-20 translate-y-full"} `}
      style={{zIndex: zIndex}}
    >
      {children}
    </div>
  );
};

